    "val_data_num$class <- as.numeric(val_data_num$class)\n",
    "head(val_data_num)\n",
    "\n",
    "\n",
    "\n",
    "roc <- multiclass.roc(response = val_data_num$class, predictor = pred_test_num$pred_test_num) \n",
    "\n",
    "plot.roc(roc$rocs[[1]], \n",
    "         print.auc=T,\n",
    "         legacy.axes = T)\n",
    "plot.roc(roc$rocs[[2]],\n",
    "         add=T, col = 'red',\n",
    "         print.auc = T,\n",
    "         legacy.axes = T,\n",
    "         print.auc.adj = c(0,3))\n",
    "plot.roc(roc$rocs[[3]],add=T, col = 'blue',\n",
    "         print.auc=T,\n",
    "         legacy.axes = T,\n",
    "         print.auc.adj = c(0,5))\n",
    "plot.roc(roc$rocs[[4]],add=T, col = 'green',\n",
    "         print.auc=T,\n",
    "         legacy.axes = T,\n",
    "         print.auc.adj = c(0,7))\n",
    "plot.roc(roc$rocs[[5]],add=T, col = 'pink',\n",
    "         print.auc=T,\n",
    "         legacy.axes = T,\n",
    "         print.auc.adj = c(0,9))\n",
    "plot.roc(roc$rocs[[6]],add=T, col = 'purple',\n",
    "         print.auc=F,\n",
    "         legacy.axes = T,\n",
    "         print.auc.adj = c(0,11))\n",
    "plot.roc(roc$rocs[[7]],add=T, col = 'orange',\n",
    "         print.auc=T,\n",
    "         legacy.axes = T,\n",
    "         print.auc.adj = c(0,12)) \n",
    "\n",
    "legend(x = 1,\n",
    "    legend =c(\"akiec\",\"bcc\",\"bkl\",\"df\",\"mel\",\"nv\",\"vasc\"),\n",
    "      col=c('black','red','blue','green','pink','purple','orange'), lwd = 2)\n",
    "title(\"ROC Curve for high batch and more epoch model\")\n",
    "\n",
    "\n",
    "                                                     \n",
    "                                                     "
